description:
The course provides a good foundation on the essentials of Marketing Management required in the fiercely competitive Indian Market. It covers :
 Marketing function; Marketing concept; Relationship with other functions;
 Relevance; Marketing environment; Markets; Consumer; Buyer behaviour; Market segmentation; Marketing Planning; Marketing mix; Product policy; New products; Product life cycle; Pricing; Distribution;
 Advertising and promotion; Marketing organization; Sales forecasting; Management of sales force; Marketing control

Introduction and classification of structural and functional materials; High Temperature Materials: Structure, Processing, mechanical behaviour and oxidation resistance of Stainless Steels, Ni- and Co- Based Superalloys, Aluminides and Silicides, Carbon-Carbon and Ceramic Composites; 
 Shape-Memory Alloys: Mechanisms of One-way and Two-way Shape Memory Effect, Reverse Transformation, Thermoelasticity and Psuedoelasticity, Examples and Applications; Bulk Metallic Glass: Criteria for glass formation and stability, Examples and mechanical behaviour; 
 Nano-materials: Classification, size effect on structural and functional properties, Processing and properties of nanocrystalline materials, thin films and multilayered coatings, single walled and multiwalled carbon nanotubes; Soft and hard magnetic materials for storage devices: Design and Processing; Piezoelectric Materials: 
 Processing and Properties; Advanced Processes applied for Advanced Materials: Single Crystal Growth, Rapid Solidification, Inert Gas Condensation, Physical and Chemical Vapour Deposition of Thin Films
